import './App.css';
import * as React from 'react';
import NavBar from './components/NavBar.js';
import BUtton from '@mui/material/Button';

function App() {
  return (
    <div>
      <Button variant="contained">Hello World</Button>
    </div>
  );
}

function Button() {
  return (
    <button
      onClick={() => console.log('click!')}
      >
      2
    </button>
  );
}

function TextArea() {
  return (
    <textarea></textarea>
  );
}

export default App;
